import React from "react";
import s from './Navbar.module.css'
import './Navbar.module.css'
import { ReactSVGElement } from "react";
const Navbar = () => {
    return (
        <div id="open" className="open" onClick="openNav()">&#9776;
        <nav className={s.Nav}>
            <div className="Nav" id="Nav">


                <div className={s.Item}>
                    <a className ="close" onClick="closeNav()">&times;</a>
                </div>

                <div className={`${s.Item} ${s.Active}`}><a>Profile</a></div>
                <div className={s.Item}> <a>Massages</a></div>
                <div className={s.Item}><a>News</a></div>
                <div className={s.Item}><a>Music</a></div>
                <div className={s.Item}><a>Setting</a></div>

            </div>
            </nav>
            </div>





    )
}

export default Navbar
